import React from 'react';
import instagram from '../images/instagram.png'
import facebook from '../images/facebook.png'

export default function Footer() {
  return(
    <footer>
      <img 
      alt="Instagran"
      src={ instagram }
      width="50px"
      />
      <img
      alt="Facebook"
      src={ facebook }
      width="50px"
      />
      <p>Copyright&copy; 2021 - Igson Félix | Bárbara Badu</p>
    </footer>
  )
}
